import PropTypes from 'prop-types'

function Item(marca, year) {
  return(
    <>
      <li>{marca} - {year}</li>
      <p>..............................</p>
    </>
  )
}

Item.prototype = {
  marca: PropTypes.string.isRequired,
  year: PropTypes.number.isRequired,
}



export default Item
